import React from 'react'
    

function App() {

    let date = new Date(2024,1,1,2,2,1)
    date = date.getSeconds()
    let greeting=''
    
    const cssStyle={}
    
    if(date >= 1 && date<12){
          greeting='Good Moring' 
          cssStyle.color='green'
    
    }else if(date>=12 && date<19){
            greeting="Godd Evening"
            cssStyle.color='orange'
    
    }else{
            greeting="Good Night"
            cssStyle.color='blue'
    
    }

    return (
        <>
          <div>
            <h1> 
                Hello Sir,<span style = {cssStyle}> {greeting}</span>
            </h1>
          </div>
        </>
     )

}
export default App
